import React from 'react';

function Avatar(size , person){
    return(
        <img
        className="avatar"
        src="https://i.imgur.com/1bX5QH6.jpg"
        alt="Lin Lanying"
        width={size}
        height={size}
        />
    );
}

export default function Profile(){
    return(
        <Avatar 
        size = {100}
        person = {{
            name : 'Ali'
        }}
        />
    );

}
